import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Component } from 'react';
import { Button, Container, Navbar, NavbarBrand, Nav, NavItem, NavLink, Collapse, NavbarToggler } from 'reactstrap';

class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: false,
      isCategoriesOpen: false,
    };
  }

  toggleNavbar = () => {
    this.setState({ isOpen: !this.state.isOpen });
  };

  toggleCategories = () => {
    this.setState({ isCategoriesOpen: !this.state.isCategoriesOpen });
  };

  render() {
    console.log("Productos recibidos en Header:", this.props.productos); // 🔍 Depuración
    const categorias = this.props.productos.length > 0
      ? [...new Set(this.props.productos.map(producto => producto.categoria))]
      : [];

    return (
      <Navbar color="dark" dark expand="md">
        <NavbarBrand href="/">Mi App</NavbarBrand>
        <NavbarToggler onClick={this.toggleNavbar} />
        <Collapse isOpen={this.state.isOpen} navbar>
          <Nav className="ml-auto" navbar>
            <NavItem>
              <NavLink href="#">Inicio</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="#">Acerca</NavLink>
            </NavItem>

            {/* Botón "Categorías" */}
            <NavItem>
              <NavLink href="#" onClick={this.toggleCategories} style={{ cursor: 'pointer' }}>
                Categorías ▼
              </NavLink>
            </NavItem>
          </Nav>
        </Collapse>

        {/* Menú desplegable de categorías */}
        <Collapse isOpen={this.state.isCategoriesOpen} navbar>
          <Nav navbar className="bg-secondary p-2">
            {categorias.length > 0 ? (
              categorias.map((categoria, index) => (
                <NavItem key={index}>
                  <NavLink href={`#${categoria}`} className="text-white">
                    {categoria}
                  </NavLink>
                </NavItem>
              ))
            ) : (
              <NavItem>
                <NavLink href="#" className="text-white">
                  No hay categorías disponibles
                </NavLink>
              </NavItem>
            )}
          </Nav>
        </Collapse>
      </Navbar>
    );
  }
}

const Footer = () => (
  <footer className="bg-dark text-light text-center py-3 mt-5">
    <p>&copy; 2025 Mi Aplicación. Todos los derechos reservados.</p>
  </footer>
);

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      productos: [],
    };
  }

  componentDidMount() {
    fetch('https://icarosproject.com/2daw/pieles.json')
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(data => {
        console.log("Datos recibidos:", data); // 🔍 Depuración
        if (data && data.productos && Array.isArray(data.productos)) {
          this.setState({ productos: data.productos });
        } else {
          console.error("Error: La estructura del JSON no es la esperada.");
          this.setState({ productos: [] });
        }
      })
      .catch(error => {
        console.error('Error al obtener los datos:', error);
        this.setState({ productos: [] });
      });
  }

  render() {
    return (
      <div className="App">
        <Header productos={this.state.productos} />

        {/* Contenido principal */}
        <Container className="mt-4 text-center">
          <h1>Bienvenido a mi aplicación</h1>
          <Button color="primary">Dale</Button>
        </Container>

        <Footer />
      </div>
    );
  }
}

export default App;
